import React from "react";
import { FiMenu } from "react-icons/fi";

const NavbarBtn = () => {
  return (
    <div>
      <FiMenu />

      <button className="btn btn-light burger">
        <FiMenu />
      </button>
    </div>
  );
};

export default NavbarBtn;
